import React from 'react'
import { Button, FormGroup, Label, Input, FormText, Container } from 'reactstrap';
import FormControl from 'react-bootstrap-forms';
import "bootstrap/dist/css/bootstrap.css";

class Login extends React.Component {
    constructor(props) {
        super(props);
        this.state = {userName: '', password: ''};
    }

    emailChange(event) {
        this.setState({userName: event.target.userName})
    }

    passwordChange(event) {
        this.setState({password: event.target.password})
    }

    loginClicked = (event) => {
        document.getElementById("login-form").classList.add("hide");
        var confirmLogin = document.createElement("div");
        confirmLogin.innerHTML = "Welcome, " + event.target.userName;
        document.getElementById("login").appendChild(confirmLogin);
    }

    render() {
        return (
            <Container className="custom-text" id="login">
            <h1 id="login-title">Login:</h1>
            <FormGroup id="login-form">
                <h4>Enter username and password below to login!</h4>
                <br></br>
                <FormGroup>
                    <Label for="exampleName"><h4>Username</h4></Label>
                    <Input type="name" name="name" id="exampleName" placeholder="Enter email" onChange={this.emailChange} value={this.state.value} />
                </FormGroup>
                <FormGroup>
                    <Label for="exampleEmail"><h4>Password</h4></Label>
                    <Input type="password" name="password" id="password" placeholder="Password" onChange={this.passwordChange} value={this.state.value}/>
                </FormGroup>
                <Button onClick={this.loginClicked}>Login</Button>
            </FormGroup>
            </Container>


            // <Container className="custom-text">
            //     <h1 id="contact-me-title">Login:</h1>
            //     <FormGroup id="contact-me-form">
            //         <h4>Enter username and password below to login!</h4>
            //         <br></br>
            //         <FormGroup controlId="formGroupEmail">
            //             <Label><h4>Email</h4></Label>
            //             <FormControl type="email"placeholder="Enter email" />
            //         </FormGroup>
            //         <FormGroup>
            //             <Label for="exampleEmail"><h4>Email</h4></Label>
            //             <Input type="email" name="email" id="exampleEmail" placeholder="na@example.com" />
            //         </FormGroup>
            //         <Button>Submit</Button>
            //     </FormGroup>
            // </Container>
        );
    }
}

export default Login;
